import React, { useState, useEffect } from 'react'
import { auth, db } from '../firebase/firebase-config'
import { updatePassword, reauthenticateWithCredential, EmailAuthProvider } from 'firebase/auth'
import { useNavigate } from 'react-router-dom'
import { doc, getDoc, updateDoc, collection, getDocs } from 'firebase/firestore'

const Dashboard = () => {
  const navigate = useNavigate()
  const [state, setState] = useState({
    firstName: '', lastName: '', email: '', activeComponent: 'dashboard', volunteerHours: 0, isEditing: false,
    password: '', originalData: null, volunteerLog: [], bio: '', currentPassword: '', members: [], events: []
  })

  const { firstName, lastName, email, activeComponent, volunteerHours, isEditing, password, originalData, volunteerLog, bio, currentPassword, members, events } = state

  const fetchUserData = async () => {
    if (!auth.currentUser) return console.error('No authenticated user found')
    const userSnap = await getDoc(doc(db, 'users', auth.currentUser.uid))
    if (userSnap.exists()) {
      const data = userSnap.data()
      setState(prev => ({ ...prev, ...data, email: auth.currentUser.email, originalData: data }))
    } else console.error('User document does not exist')
  }

  const handleUpdateProfile = async () => {
    try {
      await updateDoc(doc(db, 'users', auth.currentUser.uid), { firstName, lastName, bio, isPublic: true })
      if (password.trim()) {
        if (!currentPassword) throw new Error('Please enter your current password to update to a new password')
        await reauthenticateWithCredential(auth.currentUser, EmailAuthProvider.credential(auth.currentUser.email, currentPassword))
        await updatePassword(auth.currentUser, password)
      }
      setState(prev => ({ ...prev, ...originalData, password: '', currentPassword: '', isEditing: false }))
    } catch (error) { alert('Failed to update profile: ' + error.message) }
  }

  const fetchCollection = async (collectionName, stateKey) => {
    const querySnapshot = await getDocs(collection(db, collectionName))
    const data = querySnapshot.docs.map(doc => ({ id: doc.id, ...doc.data() }))
    setState(prev => ({ ...prev, [stateKey]: data }))
  }

  useEffect(() => { fetchUserData() }, [])

  const handleCancel = () => setState(prev => ({ ...prev, ...originalData, password: '', currentPassword: '', isEditing: false }))

  const InputField = ({ placeholder, value, onChange, ...props }) => (
    <input placeholder={placeholder} value={value} onChange={onChange} className="w-full p-3 rounded-lg bg-white/10 border border-white/20 text-white" {...props} />
  )

  const components = {
    profile: {
      title: 'Your Profile',
      desc: 'Manage your personal information and account settings here.',
      content: (
        <div className="space-y-4">
          <div className="bg-white/10 p-6 rounded-xl">
            {isEditing ? (
              <div className="space-y-4">
                <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                  <InputField placeholder="First Name" value={firstName} onChange={e => setState(prev => ({ ...prev, firstName: e.target.value }))} maxLength={30}/>
                  <InputField placeholder="Last Name" value={lastName} onChange={e => setState(prev => ({ ...prev, lastName: e.target.value }))} maxLength={30}/>
                </div>
                <InputField placeholder="Email" value={email} disabled maxLength={50} className="opacity-50"/>
                <textarea placeholder="Bio" value={bio} onChange={e => setState(prev => ({ ...prev, bio: e.target.value }))} className="w-full p-3 rounded-lg bg-white/10 border border-white/20 text-white" rows="4" maxLength={200}/>
                <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                  <InputField placeholder="Current Password" value={currentPassword} onChange={e => setState(prev => ({ ...prev, currentPassword: e.target.value }))} maxLength={30} type="password"/>
                  <InputField placeholder="New Password" value={password} onChange={e => setState(prev => ({ ...prev, password: e.target.value }))} maxLength={30} type="password"/>
                </div>
                <div className="flex gap-4">
                  <button onClick={handleUpdateProfile} className="bg-green-500 w-full py-3 rounded-lg">Save Changes</button>
                  <button onClick={handleCancel} className="bg-gray-500 w-full py-3 rounded-lg">Cancel</button>
                </div>
              </div>
            ) : (
              <div className="space-y-4">
                <h3 className="text-2xl font-bold text-white">{firstName} {lastName}</h3>
                <p className="text-gray-300">{email}</p>
                <button onClick={() => setState(prev => ({ ...prev, isEditing: true }))} className="px-4 py-2 bg-blue-500 rounded-lg hover:bg-blue-600 text-white">Edit Profile</button>
                <p className="text-gray-300">{bio || 'No bio added yet.'}</p>
              </div>
            )}
          </div>
        </div>
      )
    },
    volunteer: {
      title: 'Volunteer Activity',
      desc: 'Track your volunteer contributions and history.',
      content: (
        <div className="space-y-4">
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            <div className="bg-white/10 p-6 rounded-xl"><h4>Total Hours</h4><p>{volunteerHours}</p></div>
            <div className="bg-white/10 p-6 rounded-xl"><h4>Activities</h4><p>{volunteerLog.length}</p></div>
          </div>
        </div>
      )
    },
    events: {
      title: 'Upcoming Events',
      desc: 'View and register for upcoming volunteer opportunities.',
      content: (
        <div className="space-y-4">
          {events.map(event => (
            <div key={event.id} className="bg-white/10 p-6 rounded-xl">
              <h3>{event.title}</h3><p>{event.date}</p>
              <button className="bg-blue-500 rounded-lg text-white">Register</button>
            </div>
          ))}
        </div>
      ),
      onMount: () => fetchCollection('events', 'events')
    },
    members: {
      title: 'Members',
      desc: 'View all registered members.',
      content: (
        <div className="space-y-4">
          {members.map((member, index) => (
            <div key={index} className="bg-white/10 p-6 rounded-xl">
              <h4>{member.firstName} {member.lastName}</h4><p>{member.email}</p>
            </div>
          ))}
        </div>
      ),
      onMount: () => fetchCollection('users', 'members')
    }
  }

  const renderComponent = () => {
    const { title, content, desc } = components[activeComponent] || {}
    return activeComponent === 'dashboard' ? (
      <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
        {Object.keys(components).map(key => (
          <div key={key} className="p-6 bg-white/10 rounded-xl cursor-pointer" onClick={() => setState(prev => ({ ...prev, activeComponent: key }))}>
            <h3>{components[key].title}</h3><p>{components[key].desc}</p>
          </div>
        ))}
      </div>
    ) : (
      <div>
        <h3>{title}</h3><p>{desc}</p>{content}
      </div>
    )
  }

  return (
    <div className="min-h-screen bg-gradient-to-b from-[#0e1e4b] to-[#0a1735]">
      <div>{renderComponent()}</div>
    </div>
  )
}

export default Dashboard
